import React from "react";

const Loader = () => {
  return (
    <div className="flex justify-center items-end h-48 relative">
      {/* Boxes */}
      {[...Array(8)].map((_, idx) => (
        <div
          key={idx}
          className={`w-5 h-12 mx-1 relative animate-bounce delay-${idx * 100}`}
        >
          <div className="w-full h-full bg-indigo-600"></div>
        </div>
      ))}
      {/* Ground */}
      <div className="absolute bottom-0 w-full h-2 bg-gray-700"></div>
    </div>
  );
};

export default Loader;
